import express from 'express';
import bodyParser from 'body-parser';

const cors = require('cors');


const app = express();
app.use(bodyParser.json());
app.use(cors());

 
const ArticleEnt = require('../models/Article');
const InventoryEnt = require('../models/Inventory');

const InventoryOb = require('../models/InventoryWithObject');
const User = require('../models/User');












// Middleware to verify JWT token
  const bcrypt = require('bcrypt');
  const jwt = require('jsonwebtoken');

  const authenticateToken = (req, res, next) => {
    const authHeader = req.headers['authorization'];
    const token = authHeader && authHeader.split(' ')[1];

    if (token == null) {
      return res.status(401).json({ error: 'Authentication failed' });
    }

    jwt.verify(token, 'secret-key', (err, user) => {
      if (err) {
        return res.status(403).json({ error: 'Invalid token' });
      }
      req.user = user;
      next();
    });
  };
// !! Middleware to verify JWT token











// Sign Up API
  app.post('/signup', async (req, res) => {
    try {
      const { email, password } = req.body;
      
      // Check if user with the same email already exists
      const existingUser = await User.findOne({ email });
      if (existingUser) {
        return res.status(409).json({ error: 'User already exists' });
      }

      // Hash the password before saving it
      const hashedPassword = await bcrypt.hash(password, 10);
      const user = new User({ email, password: hashedPassword });
      await user.save();

      res.status(201).json({ message: 'User registered successfully' });
    } catch (error) {
      console.error(error); // Log the error to the console for debugging
      res.status(500).json({ error: 'Internal server error' });
    }
  });
// !!Sign Up API




// Login API
  app.post('/login', async (req, res) => {
    try {
      const { email, password } = req.body;
      if (!email) {
        res.status(400).json({ error: 'Email is required' });
        return;
      }
      const user = await User.findOne({ email });
      if (!user) {
        res.status(401).json({ error: 'Email is not found ' });
        return;
      }
      const isPasswordValid = await bcrypt.compare(password, user.password);
      if (!isPasswordValid) {
        res.status(401).json({ error: 'Invalid  password' });
        return;
      }
      // Generate JWT token
      const token = jwt.sign({ userId: user._id }, 'secret-key');
      res.status(200).json({ token });
    } catch (error) {
      console.log(error);
      res.status(500).json({ error: 'Server error' });
    }
  });
// !!Login API





// Connexion à MongoDB 
  const mongoose = require('mongoose');
  mongoose
    .connect("mongodb+srv://yassineganayt:yassineganayt@cluster0.elldbwh.mongodb.net/InventaireDB?retryWrites=true&w=majority", {
      useNewUrlParser: true,
      useUnifiedTopology: true,
    })
    .then(() => {
      console.log('MongoDB Connecté ');
    })
    .catch((error) => {
      console.error('Erreur de connexion à MongoDB en local :', error);
    });
// !!Connexion à MongoDB 



// get request that gets the specefic inventories that were created by the user from the databse 
  app.get('/getInventories', authenticateToken, async (req, res) => {
    try {
      const emailLoggedIn = req.headers.email; // Access the email value from the request headers

      console.log("The email logged in "+emailLoggedIn)
      const inventoryObj = await InventoryOb.find({ CreatedBy:emailLoggedIn  });
      res.json(inventoryObj);
      console.log('Inventory data retrieved from the database');
    } catch (error) {
      console.error(error);
      res.status(500).json({ error: 'Server error' });
      console.log('Error while retrieving inventories:', error);
    }
  });
// !! get request that gets the specefic inventories that were created by the user from the databse 












// post request to create a new inventory element (with the mongoDB collection logic )
  app.post('/addInventoryObject', async (req, res) => {
      try {
        const { DateInsertion_DB, NomInventaire, TabArticles,CreatedBy } = req.body;
    
        const inventoryOb = new InventoryOb({
          DateInsertion_DB,
          NomInventaire,
          TabArticles,
          CreatedBy
        });
    
        await inventoryOb.save();
    
        console.log('New inventory element added:', inventoryOb);
    
        res.status(201).json({ message: 'New inventory element added successfully' });
      } catch (error) {
        console.error('Error adding inventory element:', error);
        res.status(500).json({ error: 'Server error' });
      }
  });
// !!post request to create a new inventory element (with the mongoDB collection logic )






// csv Work
  const csv = require('csv-parser');
  const fs = require('fs');
    // post request to import a CSV file 
      app.post('/importCSV', async (req, res) => {
        try {
          const file = req.body.file; 

          const results = [];
          fs.createReadStream(file)
            .pipe(csv({ separator: ';' }))
            .on('data', (data) => {
              const { id, Article, Designation, Lot, DateFabrication, Date_Premption, Emplacements, Nom_Emplacement } = data;
              results.push({
                id,
                Article,
                Designation,
                Lot,
                DateFabrication,
                Date_Premption,
                Emplacements,
                Nom_Emplacement
              });
            })
            .on('end', () => {
              console.log('Lecture du fichier CSV terminée');
              res.json(results); // Envoyer les données dans la réponse JSON
            })
            .on('error', (error) => {
              console.error('Erreur lors de la lecture du fichier CSV:', error);
              res.status(500).json({ error: 'Erreur du serveur', errorMessage: error.message });
            });
        } catch (error) {
          console.error(error);
          res.status(500).json({ error: 'Erreur du serveur' });
        }
      });

      app.listen(8000, () => {
        console.log("Le serveur écoute sur le port 8000");
      });
    // !!post request to import a CSV file 
// !!csv work




// code that was created and it was changed or it reveals that it's no longer necessary
  // post request to add a new article to the database
    app.post('/CreateNewArticle', async (req, res) => {
      const {
        Article,
        Designation,
        Lot,
        DateFabrication,
        Date_Premption,
        Emplacements,
        Nom_Emplacement,
        Quantite1,
        Quantite2,
        Quantite3,
        IdInventaireAttaché,
        DateInsertion_DB
      } = req.body;
      try {
        const article = new ArticleEnt({
          Article,
          Designation,
          Lot,
          DateFabrication,
          Date_Premption,
          Emplacements,
          Nom_Emplacement,
          Quantite1,
          Quantite2,
          Quantite3,
          IdInventaireAttaché,
          DateInsertion_DB
        });
        await article.save();
        console.log('Data inserted successfully:', article);

        res.status(200).json({ message: 'Data inserted successfully' });
      } catch (error) {
        console.error('Error inserting data:', error);
        res.status(500).json({ error: 'Server error' });
      }
    });


  // post request to create a new inventory element (with the sql logic )
    app.post('/addInventory', async (req, res) => {
      const { DateInsertion_DB, NomInventaire,Id_Attachement_DB } = req.body;
      try {
        const Inventory = new InventoryEnt({ DateInsertion_DB, NomInventaire,Id_Attachement_DB });
        await Inventory.save();
        console.log('Inventory element  inserted successfully:', Inventory);

        res.status(200).json({ message: 'Inventory element  inserted successfully' });
      } catch (error) {
        console.error('Error inserting data:', error);
        res.status(500).json({ error: 'Server error' });
      }
    });
  // !!post request to create a new inventory element (with the sql logic )

